        {[1, 2, 3, 4, 5].map((num) => (
          <button
            key={num}
            onClick={() => setRating(num)}
            className={`text-3xl ${
              rating >= num ? "text-yellow-400" : "text-gray-500"
            }`}
          >
            â˜…
          </button>
        ))}
      </div>
      <p className="text-gray-300">
        {rating > 0
          ? `You rated us ${rating} star${rating > 1 ? "s" : ""}.`
          : "Click a star to rate."}
      </p>
    </div>
  );
}
